// SPDX-License-Identifier: MIT
// Guild contract
pragma solidity ^0.8.0;

import '@openzeppelin/contracts/token/ERC20/ERC20.sol';

contract Guild is ERC20 {

    struct Member {
        bool valid;
        uint8 grade;
        uint256 createdAt;
        uint256 chestETH;
        address addBy;
        address addressMember;
    }

    struct Invit {
        bool valid;
        address addr;
        string description;
    }

    struct Grade {
        bool valid;
        bool write;
        bool read;
        bool invit;
        bool desinvit;
        bool sendMoney;
        bool takeMoney;
        bool graduate;
        string name;
    }

    mapping( uint8 => Grade ) _grades;
    mapping( uint256 => Member ) _members;
    mapping( uint256 => Invit ) _invits;
    uint256 id;
    uint256 nonceMember;
    uint256 countMember;
    uint256 countInvit;
    address payable owner;
    address myosAddress;

    constructor(string memory name, string memory symbol, address payable _owner, address _myosAddress, uint _id) ERC20(name,symbol)  {
        owner = _owner;
        myosAddress = _myosAddress;
        id = _id;
    }

    modifier onlyCreator(){
        require(msg.sender == owner || msg.sender == myosAddress,"Not your guild");
        _;
    }

    /**
    appel direct depuis web3 (on ne passe pas par delegate contract)
     */
    function setGrade(uint8 _id, bool valid, bool write, bool read, bool invit, bool desinvit, bool sendMoney, bool takeMoney, bool graduate, string memory name ) external onlyCreator {
        require(_id>0&&_id<10,"10 Grade Max");
        _grades[_id] = Grade(valid,write,read,invit,desinvit,sendMoney,takeMoney,graduate,name);
    }

    /**
    appel direct depuis web3 (on ne passe pas par delegate contract)
     */
    function getGrade(uint8 _id) external view returns (Grade memory){
        return _grades[_id];
    }

    /**
    SUBSCRIBE SECTION
     */
    function suscribe(string memory description) external {
        _invits[countInvit] = Invit(true,msg.sender,description);
        countInvit++;
    }

    /**
    appel direct depuis web3 (on ne passe pas par delegate contract)
     */
    function unsuscribe(uint256 invit) external {
        require(_invits[invit].valid == true,"This invitation is no more valid");
        uint256 changerId;
        for (uint256 index = 0; index < countMember; index++) {
            if(_members[index].addressMember == msg.sender) changerId = index;
        }
        require(_invits[invit].addr == msg.sender || (_members[changerId].valid == true && _grades[_members[changerId].grade].desinvit == true) ,"Your are not authorized to do this");
        _invits[invit].valid = false;
    }

    /**
    appel direct depuis web3 (on ne passe pas par delegate contract)
     */
    function getOneSubscription(uint256 invit) external view returns (Invit memory){
        require(_invits[invit].valid == true,"This invitation is no more valid");
        return _invits[invit];
    }

